data.action:
number_valid_switch: f.number_valid_switch,
number: f.number;

if (number_valid_switch.value) {
change number validations { "odd" }
} else {
change number validations { new
com.netgrif.application.engine.petrinet.domain.dataset.Validation('''inrange
${min.value as Integer},${max.value as Integer}''', true) }
}

text_valid_switch: f.text_valid_switch ,
text: f.text;

if (text_valid_switch.value) {
    change text validations { "email" }
} else {
    change text validations {
        new com.netgrif.application.engine.petrinet.domain.dataset.Validation(
                '''log.info("running");maxLength ${max.value as Integer}''',
                new com.netgrif.application.engine.petrinet.domain.I18nString(""))
    }
}
